import React from 'react';
import Product from './Product';

const Main = ({ products }) => {
    return (
        <div className="main">
            const Main = ({products}) => (
            <div className="main">
                {products.map(product => <Product key={product.id} {...product} />)}
            </div>
            );
        </div>
    );
};

export default Main;
